import React from 'react';
import '../css/Map.css';

const Map = ({ setDestination }) => {
    const cities = [
        { name: 'Seoul', style: { top: '30%', left: '50%' } },
        { name: 'Busan', style: { top: '70%', left: '80%' } },
        { name: 'Daegu', style: { top: '60%', left: '60%' } },
        { name: 'Incheon', style: { top: '30%', left: '40%' } }
        // 필요한 다른 도시를 여기에 추가
    ];

    return (
        <div className="map-container">
            <img src="/path/to/your/map/image.png" alt="Map" className="map-image" />
            {cities.map(city => (
                <button
                    key={city.name}
                    className="city-button"
                    style={city.style}
                    onClick={() => setDestination(city.name)}
                >
                    {city.name}
                </button>
            ))}
        </div>
    );
};

export default Map;
